import React,{Component} from 'react';
import TopNavLeftIcon from './TopNavLiftIcon';



class TopNavLeft extends Component {
     
    render() {
        return (
            <div className=" col-lg-6 col-md-6 col-sm-12 col-xs-12">
                <ul className="list-inline hover-red">
                 
                    <TopNavLeftIcon className="fab fa-facebook-f" href="https://www.facebook.com/"/>
                    <TopNavLeftIcon className="fab fa-google-plus-g" href="https://plus.google.com/"/>
                    <TopNavLeftIcon className="fab fa-twitter" href="https://twitter.com"/>
                    <TopNavLeftIcon className="fab fa-linkedin-in" href="https://www.linkedin.com"/>
                    <TopNavLeftIcon className="fab fa-instagram" href="https://www.instagram.com"/>
                    
                </ul>
            </div>
        )
    };
}
export default TopNavLeft;
